import React from "react";



import './Conteudo.css'

function Conteudo(){
    return(
        <div className="conteudo">
            <Container>
                <Row>
                    <Col sm={8}>sm=8</Col>
                    <Col sm={4}>sm=4</Col>
                </Row>
            </Container>

        </div>
    )
}

export default Conteudo;
